  [],\n\t\"num_tags\": 18,\n\t\"name\": \"underway-meteorological-navigational-physical-and-time-series-data-collected-aboard-the-no-8dabb\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0123614 contains raw underway
  meteorological, navigational, physical and time series data logged by the Scientific
  Computer System (SCS) aboard the NOAA Ship Thomas Jefferson in the North Atlantic
  Ocean from 2013-09-24 to 2013-11-04. Office of Marine and Aviation Operations (OMAO)
  personnel aboard the ship submitted these data and associated metadata to NODC.
  In addition, NODC Accession 0123614 contains supplementary cruise-level metadata,
  which OMAO personnel logged in the Ship Daily Activity Log (SDAL). OMAO and NODC
  personnel developed the automated process to archive these data under the auspices
  of the NOAA Rolling Deck to Repository (NOAA R2R) program.\",\n\t\"owner_org\":
